import React from "react";

export const Footer = () => {
  return (
    <div className="footer">
      <div className="top"></div>
      <div className="item">
         <h1>Categories</h1>
         <span>Painting</span>
         <span>Jewelry</span>
      </div>
      <div className="item">
        h1
      </div>
      <div className="item"></div>
      <div className="item"></div>
      <div className="bottom"></div>
    </div>
  );
};

export default Footer;
